import { ScrollView } from "react-native";
import { DataTable } from "react-native-paper";

export default function ScoreBoardScreen() {
  return (
    <ScrollView>
      <DataTable>
        <DataTable.Header>
          <DataTable.Title numeric>Vivian</DataTable.Title>
          <DataTable.Title numeric>Fl√°vio</DataTable.Title>
          <DataTable.Title numeric>Sarita</DataTable.Title>
          <DataTable.Title numeric>Debora</DataTable.Title>
        </DataTable.Header>
      </DataTable>
    </ScrollView>
  );
}
